const express = require('express')
const cors = require('cors')
const fs = require('fs')
const axios = require('axios').default

// open server
const PORT = process.env.PORT || 3001
const app = express()

const server = app.listen(PORT,() => {
    console.log(`open port ${PORT}`)
})

// middleware
app.use(cors())


//read image
const readImage = () => {
    return new Promise((resolve,reject) => {
        fs.readFile('./images/example.jpg',(err,data) => {
            if(err) throw err
            //const base64Image = new Buffer.from(data).toString('base64')
            const base64Image = ""
            return resolve(base64Image)
        })
    })
} 

//to object
const toObject = (photoName, base64Image) => {
    const object = {
        photo_name: photoName,
        base64_image: base64Image
    }
    return object
}

//post
const fetchUserPost = (postData) => {
    return new Promise((resolve, reject) => {
        axios.post('http://211.21.248.15:15800/faceshape_hairstyle_analyze_64', postData, {
            headers: {'Content-Type': 'application/json'}  
        })
            .then(res => res.data)
            .then(data => resolve(data))
            .catch(error => console.log(error.message))
    })
}

//api
app.get('/faceshape_hairstyle', async (req,res) => {
    const photoName = "1111"
    const base64Image = await readImage()
    const postData = toObject(photoName, base64Image)
    const result = await fetchUserPost(postData)
    res.json(result)
})


